import axios from 'axios'
import {useEffect, useState} from 'react'
import styled from 'styled-components'

const CardPerfil = styled.div`
width:100%;
height:30px;
display:flex;
margin-botton: 5px;
justify-content: start; 
>img{
width:30px;
border-radius: 5px;
margin-left: 10px;


}


`



function Tela(){

    const [matches, setMatches] = useState([])
 
    const Matches = () => {
        axios.get("https://us-central1-missao-newton.cloudfunctions.net/astroMatch/:mayra-carver/matches")
        .then((res) => {
            setMatches(res.data.matches)
            console.log(res)
           
        })
        .catch((err) => {
            console.log(err.response)
        })
    }
 
  useEffect(() => {
      Matches()
  },[])
    
return(
    <div>
       {
           matches.map((match) => {
               return(
                   <CardPerfil>
                       <img src={match.photo}/>
                       <p>{match.name}</p>
                       
                   </CardPerfil>
               )
           })
       }
    </div>
)

}   
export default Tela;
